import React from 'react';
import Base from '../core/Base';

const ManageProducts = () => {
    return (
        <Base>
            <div className="container text-muted text-center">
                <h1 className="heading-2 mt-3">Manage Products Here</h1>
            </div>
        </Base>
    );
}

export default ManageProducts;
